import Colors from "../css/Colors";

const SalesOrganizationStyle = {
    headerShown: true,
    headerTitle: "Filter By: Sales Organization",
    headerTintColor: Colors.whiteColor,
    headerStyle: {
      backgroundColor: Colors.pageBgColor,
    }
}

export default SalesOrganizationStyle
